import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

const cardStyles = makeStyles({
  root: {
    width: 275,
    height: 300,
    margin: 35,
    position: 'absolute',
    bottom: 50,
    borderRadius: 25,
  },
  title: {
    fontSize: 20,
    top: '5%',
    position: 'absolute',
  },
  secondTitle: {
    fontSize: 20,
    top: '40%',
    position: 'absolute',
  },
  pos: {
    marginTop: 12,
    position: 'relative',
  },
  moreDetails: {
    position: 'absolute',
    padding: '5%',
    right: 0,
    top: 0,
    fontFamily: 'Calibri',
  },
});

export default function SimpleCard() {
  const classes = cardStyles();

  return (
    <Card className={classes.root}>
      <CardActions>
        <Button size="small" className={classes.moreDetails}>More Details</Button>
      </CardActions>
      <CardContent>
        <Typography className={classes.title} gutterBottom>Brighton</Typography>
        <Typography className={classes.pos} color="textSecondary">25C</Typography>
        <Typography className={classes.secondTitle} gutterBottom>Clothing Suggestions</Typography>
      </CardContent>
    </Card>
  );
}

const element = <SimpleCard name="Sara" />;


//Map component
class Map extends React.Component {
  render() {
    return <React.Fragment>
      <div style={{ zIndex: 0 }}><iframe class="map-iframe"
        src="https://embed.windy.com/embed2.html?lat=52.896&lon=-2.241&detailLat=51.914&detailLon=-1.346&width=1600&height=900&zoom=7&level=surface&overlay=wind&product=ecmwf&menu=&message=&marker=&calendar=now&pressure=&type=map&location=coordinates&detail=&metricWind=default&metricTemp=default&radarRange=-1"
        frameborder="0">
      </iframe></div>

      <div style={{ zIndex: 0 }}><SimpleCard /></div>
    </React.Fragment>
  }
}

//Tile component
class Card2 extends React.Component {
  render() {
    return <div><iframe class="map-iframe"
      src="https://embed.windy.com/embed2.html?lat=52.896&lon=-2.241&detailLat=51.914&detailLon=-1.346&width=1600&height=900&zoom=7&level=surface&overlay=wind&product=ecmwf&menu=&message=&marker=&calendar=now&pressure=&type=map&location=coordinates&detail=&metricWind=default&metricTemp=default&radarRange=-1"
      frameborder="0"></iframe></div>;
  }
}

ReactDOM.render(
  <div>
    <Map />

  </div>,
  // <React.StrictMode>
  //   <App />
  // </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
